import React, { Component } from "react";
import axios from "axios";

class Silkum extends Component {
  render() {    
    let result = [];
    axios
    .get("http://seeho.kro.kr:3010/json")
    .then(function(res) {
        result = res.data;   
        console.log(result);     
    })
    .catch(function(err) {
      console.log(err);
    });

    return (
      <>
        <div>
        {result[0]}
        hi2 {console.log('hi')}
        </div>
      </>
    );
  }
}

export default Silkum;
